import React from 'react';

function LocationSearch() {
  return (
    <div style={{
      padding: '10px',
      backgroundColor: '#1a1a1a',
      display: 'flex',
      alignItems: 'center',
      borderRadius: '20px',
      margin: '10px',
      color: '#ccc'
    }}>
      <span style={{ marginRight: '10px' }}>üìç</span>
      <input
        type="text"
        placeholder="Current Location"
        style={{
          flex: 1,
          backgroundColor: 'transparent',
          border: 'none',
          outline: 'none',
          color: '#fff',
          fontSize: '16px'
        }}
      />
      <button style={{
        backgroundColor: '#4a90e2',
        border: 'none',
        borderRadius: '15px',
        padding: '6px 12px',
        color: '#fff',
        cursor: 'pointer'
      }}>
        üîç
      </button>
    </div>
  );
}

export default LocationSearch;
